import React, { useEffect, useState } from 'react'
import HOC from './HOC'

const Userlist = ({ data }) => {
    let renderedusers = data.map((user) => {
        return (
            <div key={user.id}>
                <p>
                    <strong>{user.name}</strong>
                </p>
            </div>
        )
    })

    return (

        <div>

            {renderedusers}
        </div>
    )
}
const SearchUser = HOC(Userlist, "user");
export default  SearchUser
